import CourtCard from "../../components/CourtCard";

export default function CourtList({ courts, computedById, selectedId, onSelect }) {
  if (!courts.length) {
    return (
      <div className="rounded-3xl bg-white/70 border border-white shadow-soft p-10 text-center">
        <div className="text-xl font-extrabold">No matches ðŸ¥²</div>
        <div className="text-slate-600 mt-2">
          Try a different island, skill level, or search term.
        </div>
      </div>
    );
  }

  return (
    <div className="grid gap-3">
      {courts.map((c) => (
        <CourtCard
          key={c.id}
          court={c}
          meta={computedById[c.id]}
          selected={selectedId === c.id}
          onClick={() => onSelect(c.id)}
        />
      ))}
    </div>
  );
}
